function sleep(sec) {
  return new Promise((resolve, reject) => {
    setTimeout(() => {
      console.log('\u7B49\u5F85\u4E86' + sec + '\u79D2')
      resolve()
    }, sec * 1000)
  })
}

const limitPromise = (limit=5) => {
  const queue = []
  const that = this
  let count = 0
  return (fn: Promise, ...arg)=>{
    const task = function() {
      new Promise((resolve, reject) => {
        fn.apply(that, ...arg).then((res)=>{
          resolve(res)
        }).catch(err=>{
          reject(err)
        }).finally(()=>{
          
        })
      })
    }
    queue.push(task)
    // return
    // \u5224\u65AD\u9650\u5236\u6570\u91CF\u662F\u5426\u6EE1\u8DB3
    if (count < limit){
      count++
    }
  }
}

const call = limitPromise(10)
call(sleep, 1)
call(sleep, 2)
call(sleep, 3)
call(sleep, 4)
call(sleep, 5)

